body.query:
fragment EntityTinyFragment on Entity {
  id: _id
  title
  __typename
}

fragment PersonTinyFragment on Person {
  id: _id
  name
  __typename
}

query people_actors($page: Int, $field: String, $withActed: Boolean!, $withProduced: Boolean!, $withDirected: Boolean!, $withWrote: Boolean!) {
  people(
    page: $page
    field: $field
    withActed: $withActed
    withWrote: $withWrote
    withDirected: $withDirected
    withProduced: $withProduced
  ) {
    ...PersonTinyFragment
    directed @include(if: $withDirected) {
      id {
        ...EntityTinyFragment
        __typename
      }
      __typename
    }
    acted @include(if: $withActed) {
      id {
        ...EntityTinyFragment
        __typename
      }
      __typename
    }
    produced @include(if: $withProduced) {
      id {
        ...EntityTinyFragment
        __typename
      }
      __typename
    }
    wrote @include(if: $withWrote) {
      id {
        ...EntityTinyFragment
        __typename
      }
      __typename
    }
    __typename
  }
}
